import React from 'react';

import { Box, Container, Grid, Typography } from '@mui/material';
import { styled } from '@mui/system';



import ibrahim from "../assets/images/ibrahim.png";
import ahmad from "../assets/images/ahmad.png";
import '../css/contactUs.css';

const Doctors = () => {
    return (
        <>
            <div className="doctors-container">
                <div className="doctor">
                    <img src={ibrahim} alt="Dr. Ibrahim" />
                    <h2>Dr. Ibrahim</h2>
                    <p className="doctor-description">
                        Dr. Ibrahim is an experienced physician specializing in internal medicine. He completed his medical degree at the University of Michigan and his residency at Johns Hopkins University. He has been in practice for over 15 years and has a passion for helping his patients achieve their health goals.
                    </p>
                </div>
                <div className="doctor">
                    <img src={ahmad} alt="Dr. Ahmad" />
                    <h2>Dr. Ahmad</h2>
                    <p className="doctor-description">
                        Dr. Ahmad is a board-certified cardiologist with over 20 years of experience. He completed his medical degree at Harvard University and his fellowship in cardiology at the Cleveland Clinic. He is passionate about using the latest technology and techniques to provide the best possible care for his patients.
                    </p>
                </div>
            </div>
        </>
    );
}

export default Doctors;
